import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  cars: [
    "Model S",
    "Model 3",
    "Model X",
    "Model Y",
    "solar roof",
    "solar panels",
  ],
};

const carSlice = createSlice({
  name: "car",
  initialState,
  reducer: {},
});

export const selectCars = (state) => state.car.cars;

export default carSlice.reducer;
